var base64 = require('base-64')
const utf8 = require('utf8')

exports.handler = async function (event) {
  let fontSize = 66
  let lineHeight = 1.3
  let text = 'Home of fearless web developer Silvestar BistroviÄ‡'

  if(event.queryStringParameters && event.queryStringParameters.text) {
    text = event.queryStringParameters.text
  }

  if (text && text.length > 40) {
    fontSize = 55
  }

  if (text && text.length > 80) {
    fontSize = 44
  }

  const svg = `<svg width="1200" height="630" viewBox="0 0 1200 630" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><rect width="1200" height="630" rx="20" fill="white"/><rect x="56" y="56" width="1088" height="518" rx="15" stroke="#FF3366" stroke-width="14"/><rect x="100" y="100" width="125" height="126" fill="url(#pattern0)"/><defs><pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1"><use xlink:href="#image0_1411_54" transform="scale(0.004 0.00396825)"/></pattern><image id="image0_1411_54" width="250" height="252" xlink:href="data:image/png;base64,"/></defs><style>@font-face{font-family:'PlayfairDisplay-Regular';src:url('data:font/woff2;charset=utf-8;base64,') format('woff2');font-weight:normal;font-style:normal;font-display:swap}</style><style>h1{font-family:'PlayfairDisplay-Regular',serif;font-weight:bold;font-size:${fontSize}px;line-height:${lineHeight};letter-spacing:.025em;margin:0}</style><foreignObject x="260" y="279" height="247" width="766"><h1 xmlns="http://www.w3.org/1999/xhtml">${utf8.encode(text)}</h1></foreignObject></svg>`

  try {
    return {
      statusCode: 200,
      body: base64.encode(svg),
      headers: {
        "content-type": "image/svg+xml"
      },
      isBase64Encoded: true,
    }
  } catch (error) {
    console.log(error)

    return {
      statusCode: 200,
      body: 'Error!',
      headers: {
        "content-type": "text"
      }
    }
  }
}
